import "./home.css";

function Home() {
  return (
    <div className="App">
      <div className="profile-container">
        조성현, Cho SeongHyeon - WillKi 웹 개발, 인공지능, Problem
        Solving(알고리즘)에 관심을 갖고 있는 전 대학생입니다. 새로운 문제를 찾고
        해결하는 과정을 즐기며 스스로를 발전시키는 과정을 좋아합니다.
      </div>
    </div>
  );
}

export default Home;
